<!DOCTYPE html><html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en-us"><head><style type="text/css"> @import url('http://www.gnu.org/software/emacs/manual.css');</style></head><body style="padding:1rem;"><strong>remove-duplicates</strong> is an alias for `<strong><a href="/Fun/cl-remove-duplicates.html">cl-remove-duplicates</a></strong>' in `<code>cl.el</code>'.</br>
</br>
(remove-duplicates <u>SEQ</u> [<u>KEYWORD</u> <u>VALUE</u>]...)</br>
</br>
Return a copy of <u>SEQ</u> with all duplicate elements removed.</br>
</br>
Keywords supported:  :test :test-not :key :start :end :from-end<br/><br/><br/><br/><small>A courtesy of <a href="http://endlessparentheses.com/">Endless Parentheses</a>.</small></body></html>
